import React from 'react';
import './CardInfo.css';

const CardInfo = () => {
    return (
        <>
            <div className='page_container'>
                <form className='cardInfo_form'>
                    <label>
                        CARDHOLDER NAME:
                        
                    </label>
                </form>
            </div>
        </>
    );
}

export default CardInfo;
